import React, { Component } from 'react'
import { Table } from 'reactstrap'

export default class downloadSelected extends Component {

    styleSheets = {
        mainContainer: {
            width: "100vw",
            height: "100vh",
            position: "fixed",
            backgroundColor: "rgba(0,0,0,0.2)",
            zIndex: 2
        },
        layoutContainer: {
            width: "60vw",
            height: "90vh",
            position: "absolute",
            margin: "auto",
            inset: 0,
            backgroundColor: "#fff",
        },
        header : {
            width : "50vw",
            height : "3vh"
        }
    }




    render() {
        const { mainContainer, layoutContainer ,header } = this.styleSheets




        return (
            <div style={mainContainer}>
                <div style={layoutContainer}>
                    <div>
                        <Table>
                            <thead>
                                <tr style={header}>

                                </tr>
                            </thead>
                        </Table>
                    </div>
                </div>
            </div>
        )
    }
}
